class nodes_details():
    def __init__(self, node):
        self.node = node
        self.neighbors = {}

def find_overlap_find(node, neighbor):
    min_overlap_len = 8
    
    start = 0
    while True:
        start = node.find(neighbor[0:min_overlap_len], start)
        if start == -1:
            return (-1, 0)
        if neighbor.startswith(node[start:]):
            overlap_start = start
            overlap_length = len(node) - overlap_start
            return (overlap_start, overlap_length)
        start += 1
        
        
def find_overlap_naive_optimized(node, neighbor):
    min_overlap_len = 50
    error_limit = 2
    start = 0 
    
    while start < len(node) - min_overlap_len:
        error_counter = 0
        start_counter = start        
        
        overlap_index = 0
        while overlap_index < min_overlap_len:
            if error_counter > error_limit:
                break
            if node[start_counter] is not neighbor[overlap_index]:
                error_counter +=1
            overlap_index += 1
            start_counter += 1
            
        if error_counter == 2:
            if node[start_counter:] is neighbor[overlap_index : overlap_index + (len(node) - start_counter)]:
                return (start, len(node)-start) 
            
        if error_counter < error_limit:
            while start_counter < len(node):
                if error_counter > error_limit:
                    break
                if node[start_counter] is not neighbor[overlap_index]:
                    error_counter +=1
                overlap_index += 1
                start_counter += 1
                
        if error_counter <= error_limit:
            return (start, len(node)-start)
        start += 1
        
    return(-1, 0)
    

def find_overlap_naive_optimized_1(node, neighbor):
    
    min_overlap_len, error_limit, start, start_counter, error_counter, overlap_index = 50, 2, 0, 0, 0, 0
    
    while start < len(node) - min_overlap_len:       
        if error_counter > error_limit:
            error_counter, overlap_index = 0, 0
            start+=1
            start_counter = start 
            continue
        if node[start_counter] is not neighbor[overlap_index]:
            error_counter += 1
        overlap_index +=1
        start_counter +=1
                
        if error_counter <= error_limit and start_counter == len(node):
            return (start, len(node)-start)
        
    return(-1, 0)    
    
                
