def find_overlap_naive(node, neighbor):
    min_overlap_len = 4
    overlap_string = neighbor[0:min_overlap_len]
    error_limit = 0
    
    for start in range(len(node)-min_overlap_len): 
        error_counter = 0
        start_counter = start
  
        for overlap_index in range(min_overlap_len): # For each character in node checking if min_overlap exists
            if error_counter > error_limit:
                break
            if node[start_counter] is not overlap_string[overlap_index]:
                error_counter += 1
            start_counter += 1
            continue
        
        if error_counter <= error_limit: # Chcking if remaining of the node is extended to neighbor
            remaining_node_len = len(node)-start_counter
            for y in range(remaining_node_len): # Checking if remaining of the node is similar to the neighbor
                if error_counter > error_limit:
                    break
                neighbor_index = min_overlap_len + y
    
                if node[start_counter] is not neighbor[neighbor_index]:
                    error_counter += 1 
                start_counter += 1
                continue             
        
        # If error>2 after the matching go to next char of node         
        if error_counter > error_limit:
            continue
    
        overlap_start = start
        overlap_length = len(node) - overlap_start
        return (overlap_start, overlap_length)
    
    return (-1, 0) # return (-1, 0) if no match found
    
def search(node, neighbor):
    min_overlap_len = 16
    
    overlap_string = neighbor[0:min_overlap_len]
    error_limit = 2
    N = len(node)
    
    for i in range(N - min_overlap_len + 1):
        j = 0
        error_counter = 0
        while(j < min_overlap_len):
            if (node[i + j] is not overlap_string[j]):
                error_counter += 1
                if error_counter > error_limit:
                    break
            j += 1
            
        if (j == min_overlap_len):
            return (i, len(node) - i)
    return (-1, 0)       
    


def search_regex_optimized(node, neighbor):
    min_overlap_len = 4
    for match in regex.finditer("("+neighbor[:min_overlap_len]+"){s<=2}", node, overlapped=True):
        s = match.start()    
        if s >= 0:
           start_neighbor = regex.search("("+node[s:]+"){s<=2}", neighbor)
           if start_neighbor is not None and start_neighbor.start() == 0:
                   return (s, len(node) - s)
    return (-1, 0)     
        

def search_regex(node, neighbor):

    min_overlap_len = 4
    node_len = len(node)
    overlap_str = neighbor[:min_overlap_len]
    overlap_str_w_sub = "("+overlap_str+"){s<=2}" # overlap string with two substitutions allowed
    for match in regex.finditer(overlap_str_w_sub, node, overlapped=True):
        s = match.start()
        
        if s >= 0: # If match return some starting overlap
           match_str =  node[s:]
           match_str_w_sub = "("+match_str+"){s<=2}"
           start_neighbor = regex.search(match_str_w_sub, neighbor) # If the match_str "GATGATGCT" found in neigbor
           if start_neighbor is not None:
               if start_neighbor.start() == 0: # If the neighbor starts with match_str "GATGATGCT" 
                   overlap_start = s
                   overlap_length = node_len - overlap_start
                   return (overlap_start, overlap_length)
    return (-1, 0)     # return (-1, 0) if no match found



def create_nodes_object(reads_list):
    
    nodes_object_list = []
    for node_index, node in enumerate(reads_list):
        node_object = nodes_details(node_index)
        
        for index, neighbor in enumerate(reads_list):
            if node == neighbor:
                continue

            overlap_start, overlap_length = find_overlap_naive(node, neighbor)
            if overlap_start != -1:                             
                node_object.neighbors[str(index)] = overlap_length   
                
        nodes_object_list.append(node_object)
    return nodes_object_list


        
def find_next_node(neighbors_dict, visited_nodes):
    next_node = -1
    while (next_node == -1):
        max_key = int(max(neighbors_dict, key=lambda k: neighbors_dict[k]))
        if max_key not in visited_nodes:
            next_node = max_key
            return next_node            
        del(neighbors_dict[max_key])    
    
def genome_assembly(nodes_object_list):
    genome_string = ""    
    current_node = 0
    visited_nodes = []
    current_overlap_length = 0

    for node_no in range(len(reads_list)):
        if node_no == 0:
            genome_string = genome_string + reads_list[node_no]
        else:
            genome_string = genome_string + reads_list[current_node][current_overlap_length:]
        
        visited_nodes.append(current_node)
        neighbors_dict = nodes_object_list[current_node].neighbors

        if node_no == (len(reads_list) - 1):
            current_node = "0"
            current_overlap_length = neighbors_dict[str(current_node)] 
            genome_string = genome_string[0:len(genome_string)-current_overlap_length]    
        
        else: 
            current_node = int(find_next_node(neighbors_dict, visited_nodes))
            current_overlap_length = neighbors_dict[str(current_node)]   
      
    return genome_string
    
